import React from 'react';
import { Bar } from 'react-chartjs-2';
// import people varible from Chart.js
// import { people } from './Chart';



const BarChart = () => {
    return (
        <div>
            <Bar 
                data = {{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                    datasets: [
                        {
                            label: '# of Votes',
                            data: [12, 19, 3, 5, 2, 3],
                            backgroundColor: [
                                'rgba(255, 99, 132, 0.2)',
                                'rgba(54, 162, 235, 0.2)',
                                'rgba(255, 206, 86, 0.2)',
                                'rgba(75, 192, 192, 0.2)',
                                'rgba(153, 102, 255, 0.2)',
                                'rgba(255, 159, 64, 0.2)'
                            ],
                        }
                    ]
                }}
                height = {400}
                width = {600}
        />
        </div>
    )
}

export default BarChart;
